Here's a sample SQL injection payload that can be used to execute data exfiltration from a user table:

```sql
INSERT INTO `users` (`name`, `email`) VALUES ('John', '<EMAIL>');
SELECT * FROM `users`;
```

To execute this payload, replace `'John'` and `<EMAIL>` with the user data you want to exfiltrate, replacing `''` with the character of your choosing (e.g., `"` for double quotes). The payload will execute a SELECT statement to query the users table and output all available data.
